import React, { useState, useEffect, useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import { ArrowRight, Globe, Shield, Clock, ArrowUpRight } from 'lucide-react';

const HomePage = () => {
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });
  const navigate = useNavigate();

  const features = [
    {
      icon: <Globe className="w-16 h-16 text-indigo-400" />,
      title: "Global Reach",
      description: "Send payments to over 180 countries worldwide with real-time tracking and competitive rates.",
      gradient: "from-blue-500 via-indigo-500 to-purple-500"
    },
    {
      icon: <Shield className="w-16 h-16 text-indigo-400" />,
      title: "Bank-Grade Security",
      description: "Enterprise-level encryption and multi-factor authentication to keep your transactions secure.",
      gradient: "from-purple-500 via-pink-500 to-red-500"
    },
    {
      icon: <Clock className="w-16 h-16 text-indigo-400" />,
      title: "24/7 Processing",
      description: "Process payments around the clock with our automated SWIFT system.",
      gradient: "from-emerald-500 via-teal-500 to-cyan-500"
    }
  ];

  useEffect(() => {
    const handleMouseMove = (e) => {
      setMousePosition({ x: e.clientX, y: e.clientY });
    };
    window.addEventListener('mousemove', handleMouseMove);
    return () => window.removeEventListener('mousemove', handleMouseMove);
  }, []);

  const ParticleBackground = () => (
    <div className="absolute inset-0 overflow-hidden">
      {[...Array(100)].map((_, i) => (
        <div
          key={i}
          className="particle absolute rounded-full"
          style={{
            width: Math.random() * 4 + 1,
            height: Math.random() * 4 + 1,
            background: `rgba(${Math.floor(Math.random() * 255)}, ${Math.floor(
              Math.random() * 255
            )}, ${Math.floor(Math.random() * 255)}, ${Math.random() * 0.3})`,
            left: `${Math.random() * 100}%`,
            top: `${Math.random() * 100}%`,
            animation: `float ${Math.random() * 15 + 5}s ease-in-out infinite`,
            transform: `translateY(${Math.sin(Date.now() / 1000 + i) * 10}px)`,
          }}
        />
      ))}
    </div>
  );

  const GradientButton = ({ children, onClick }) => (
    <button
      onClick={onClick}
      className="group relative overflow-hidden rounded-full px-12 py-4 transition-all duration-500 hover:scale-105"
    >
      <div className="absolute inset-0 bg-gradient-to-r from-indigo-500 via-purple-500 to-pink-500 transition-transform duration-500 group-hover:scale-105" />
      <div className="relative flex items-center justify-center space-x-2 text-white text-lg font-medium">
        {children}
      </div>
    </button>
  );

  return (
    <div className="relative flex flex-col min-h-screen overflow-hidden">
      {/* Custom cursor effect */}
      <div 
        className="fixed w-8 h-8 pointer-events-none z-50 rounded-full border-2 border-indigo-500 transform -translate-x-1/2 -translate-y-1/2 transition-transform duration-100 mix-blend-difference"
        style={{ 
          left: mousePosition.x,
          top: mousePosition.y,
        }}
      />

      {/* Hero Section */}
      <header className="relative min-h-screen bg-gradient-to-br from-indigo-900 via-purple-800 to-indigo-900">
        <ParticleBackground />

        <div className="relative max-w-7xl mx-auto py-32 px-4 sm:px-6 lg:px-8 text-center">
          <h1 className="text-7xl font-black text-transparent bg-clip-text bg-gradient-to-br from-white via-indigo-200 to-purple-300 animate-gradient pb-4">
            International Payment System
          </h1>
          <p className="text-3xl text-indigo-200 font-light tracking-wide">
            Secure Transactions • Simplified Payments • Global Reach
          </p>
          <GradientButton onClick={() => navigate('/login')}>
            Get Started
            <ArrowRight className="ml-2" />
          </GradientButton>
        </div>
      </header>

      {/* Features Section */}
      <section className="relative py-32 bg-gray-900">
        <div className="relative max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 text-center mb-20">
          <h2 className="text-5xl font-bold text-transparent bg-clip-text bg-gradient-to-r from-indigo-300 to-purple-300">
            Powerful Features
          </h2>
          <p className="text-xl text-indigo-200 max-w-2xl mx-auto">
            Experience the future of international payments with our cutting-edge platform.
          </p>
        </div>

        <div className="grid md:grid-cols-3 gap-8">
          {features.map((feature, index) => (
            <div
              key={index}
              className="group relative p-8 rounded-3xl backdrop-blur-xl bg-white/10 border border-white/20 transform transition-all duration-500 hover:scale-105 hover:-translate-y-2"
            >
              <div className="p-4 rounded-2xl bg-white/5 w-fit mx-auto">
                {feature.icon}
              </div>
              <h3 className="text-2xl font-semibold text-white text-center">{feature.title}</h3>
              <p className="text-indigo-200 text-center">{feature.description}</p>
              <div className="pt-4 text-center">
                <a href="#" className="inline-flex items-center text-indigo-400 hover:text-indigo-300">
                  Learn more <ArrowUpRight className="ml-2 w-4 h-4" />
                </a>
              </div>
            </div>
          ))}
        </div>
      </section>

      {/* Team Section */}
      <section className="relative py-32 bg-gray-900">
        <div className="relative max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <h2 className="text-6xl font-bold text-center text-transparent bg-clip-text bg-gradient-to-r from-indigo-300 to-purple-300 mb-20">
            Meet Our Team
          </h2>
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-12">
            {/* Team Members */}
            {/* Add team member details here */}
          </div>
        </div>
      </section>

      {/* Footer */}
      <footer className="relative bg-gray-900 text-white py-16">
        <div className="relative max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="text-center space-y-6">
            <h3 className="text-3xl font-bold bg-clip-text text-transparent bg-gradient-to-r from-indigo-300 to-purple-300">
              Risk Rangers Team
            </h3>
            <p className="text-xl text-indigo-200">
              Mpho Ndlela • Alec Cowan • Lucian Young • Anele Siwela
            </p>
          </div>
        </div>
      </footer>

      <style jsx global>{`
        @keyframes float {
          0%, 100% { transform: translateY(0); }
          50% { transform: translateY(-20px); }
        }

        @keyframes gradient {
          0% { background-position: 0% 50%; }
          50% { background-position: 100% 50%; }
          100% { background-position: 0% 50%; }
        }

        .animate-gradient {
          background-size: 400% 400%;
          animation: gradient 8s ease infinite;
        }

        .particle {
          animation: float infinite;
        }
      `}</style>
    </div>
  );
};

export default HomePage;
